import React, { useState } from "react";
import { Form, Row, Col } from "react-bootstrap";

function PlayerField({ stt, player }) {

    return (
        <Row>
            <Col sm={1}>
                <Form.Group className="mb-3" style={{ textAlign: "center" }}>
                    {stt}
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={data.playerName}
                        onChange={(e) =>
                                data.playerName = e.target.value
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={2}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="date"
                        value={data.dayOfBirth}
                        onChange={(e) =>
                            setData({
                                ...data,
                                dayOfBirth: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={data.playerType}
                        onChange={(e) =>
                            setData({
                                ...data,
                                playerType: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={data.playerNote}
                        onChange={(e) =>
                            setData({
                                ...data,
                                playerNote: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
        </Row>
    );
}

export default PlayerField;
